        var arraylength = eventsArray.length;
        for(i=0;i<arraylength;i++){
            s += "<tr>";
            for(j=0;j<3;j++)
            {
                s+="<th>";
                s+="<EvCard name={eventsArray[i].name} description={eventsArray[i].description} howFar={eventsArray[i].howFar}  attending={eventsArray[i].attending}/>";
                s+="</th>";
                if(i===(arraylength-1))
                {
                    break;
                }
                i++;
            }

           s += "</tr>";
    }



       var rendering = <EvCard name={eventsArray[0].name} description={eventsArray[0].description} howFar={eventsArray[0].howFar}  attending={eventsArray[0].attending}/>
    return (
        <div>
        <table>
            <tbody>
        {s}
        </tbody>
      </table>
      </div>
    );
  }
}

export default EventsList;
